import * as o from "react";
import t from "../lib/IconBase.es.js";
import a from "../defs/Church.es.js";
const r = o.forwardRef((c, e) => /* @__PURE__ */ o.createElement(t, { ref: e, ...c, weights: a }));
r.displayName = "ChurchIcon";
const s = r;
export {
  s as Church,
  r as ChurchIcon
};
